a part of my second Semester of MArch 1 in UCD - the year group engaged with the former Magdalene Laundry Site on Sean McDermott St. UCD teamed up with the existing Open Heart City collective and Co-Lab, a group of architects who have focused their attention on the Magdalene Laundry Site. 

Throughout the semester, I focused my time on researching methods in which to archive the current state that the Laundry exists. A time in between the buildings past and its future. In time, this building will change in many ways, possibly removing the engrained history of the site. 

I worked through the medium of film and photography, capturing the distinct atmosphere of the integral spaces which would have been used actively on a daily basis. These spaces are now left derilect and deteriorating rapidly. 

The aim of this film project was to capture and archive the interior of this building. Acknowledging the past history and promoting conversation as to what to do with buildings such as these in the future.

*Disclaimer* 
Please note that this film contains sensitive imagery. Viewer discretion is advised

